import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import { 
  Users, 
  FileText, 
  Upload, 
  Share2,
  Plus
} from 'lucide-react';

const Dock = ({ items, panelHeight = 68, baseItemSize = 50, magnification = 70 }) => {
  const [hoveredIndex, setHoveredIndex] = useState(null);

  const dockItems = [
    { 
      icon: <Plus className="w-5 h-5" />, 
      label: 'Add Team Member', 
      onClick: () => window.location.href = '/app/teams',
      color: 'text-blue-400'
    },
    { 
      icon: <FileText className="w-5 h-5" />, 
      label: 'Create Survey', 
      onClick: () => window.location.href = '/app/surveys',
      color: 'text-green-400'
    },
    { 
      icon: <Upload className="w-5 h-5" />, 
      label: 'Upload 1:1', 
      onClick: () => window.location.href = '/app/entry',
      color: 'text-purple-400'
    },
    { 
      icon: <Share2 className="w-5 h-5" />, 
      label: 'Share', 
      onClick: () => {
        if (navigator.share) {
          navigator.share({
            title: 'SignalOS Dashboard',
            url: window.location.href
          });
        } else {
          navigator.clipboard.writeText(window.location.href);
          alert('Link copied to clipboard!');
        }
      },
      color: 'text-orange-400'
    }
  ];

  return (
    <div className="fixed bottom-6 left-1/2 transform -translate-x-1/2 z-50">
      <div 
        className="glass-card px-4 py-2 rounded-full border border-white/20 backdrop-blur-xl"
        style={{ height: panelHeight }}
      >
        <div className="flex items-center space-x-2">
          {dockItems.map((item, index) => {
            const isHovered = hoveredIndex === index;
            const size = isHovered ? baseItemSize + magnification : baseItemSize;

            return (
              <div
                key={index}
                className="relative flex flex-col items-center justify-center cursor-pointer transition-all duration-300 ease-out"
                style={{ width: size, height: size }}
                onMouseEnter={() => setHoveredIndex(index)}
                onMouseLeave={() => setHoveredIndex(null)}
                onClick={item.onClick}
              >
                <div 
                  className={`w-12 h-12 rounded-xl glass-card flex items-center justify-center transition-all duration-300 ${
                    isHovered ? 'scale-110 shadow-lg' : 'scale-100'
                  }`}
                  style={{ 
                    width: size * 0.8, 
                    height: size * 0.8,
                    background: isHovered ? 'rgba(255, 255, 255, 0.2)' : 'rgba(255, 255, 255, 0.1)'
                  }}
                >
                  <div className={item.color}>
                    {item.icon}
                  </div>
                </div>
                {isHovered && (
                  <div className="absolute -top-12 left-1/2 transform -translate-x-1/2">
                    <div className="glass-card px-3 py-1 rounded-lg text-xs text-white whitespace-nowrap">
                      {item.label}
                    </div>
                  </div>
                )}
              </div>
            );
          })}
        </div>
      </div>
    </div>
  );
};

export default Dock;
